import org.eclipse.jface.resource.JFaceResources;

/**
 * Adds automatic clickable links to URL's in a styled text widget.
 * Uses the StyledText LineStyleListener option to dynamically scan
 * for URl's and filenames. Listens for mouuse clicks on links and
 * uses {@link Program} to launch them.
 * <p>
 * 
 * Note: the link colour is extracted from
 * {@link JFaceColors#getHyperlinkText(org.eclipse.swt.widgets.Display)}
 * which may not be set. To set manually use:
 * 
 * <pre>
 * JFaceResources.getColorRegistry ()
 *     .put (JFacePreferences.HYPERLINK_COLOR,
 *           display.getSystemColor (SWT.COLOR_BLUE).getRGB ());
 * </pre>
 * 
 * See <ECLIPSE_HOME>/plugins/org.eclipse.rcp.source...
 * /org.eclipse.ui.workbench.../org/eclipse/ui/internal/dialogs/ProductInfoDialog.java
 * for an another example of doing this, including keyboard traversal.
 * 
 * @author Matthew Phillips <matthphil@gmail.com>
 */
public class LinkOTronSnippet
  implements LineStyleListener, Listener
{
  private static final int IN_WILDERNESS = 0;
  private static final int IN_URL = 1;
  private static final int IN_PREFIX = 2;
  private static final int AT_SCHEME_SEP = 3;
  private static final int IN_BACK_SLASH = 4;
  private static final int IN_FORWARD_SLASH = 5;

  private static final String PUNCT_CHARS = ":;,.!?)]>}\"'";

  private boolean openInBrowser;
  private List listeners;
  private Set validSchemes;
  private UrlRange [] urlRanges;
  private StyledText textField;
  private Color urlColor;
  private Cursor handCursor;
  private Cursor busyCursor;

  public static void main (String [] args)
  {
    Display display = new Display ();

    // JFaceColors.getHyperlinkText () returns black (default) outside Eclipse
    JFaceResources.getColorRegistry ().put
      (JFacePreferences.HYPERLINK_COLOR,
       display.getSystemColor (SWT.COLOR_BLUE).getRGB ());

    Shell shell = new Shell (display);
    shell.setText ("Styled Text Links");
    shell.setLayout (new GridLayout (1, true));

    // styled text
    StyledText textField = new StyledText (shell, SWT.WRAP | SWT.V_SCROLL | SWT.BORDER);
    GridData layoutData = new GridData (GridData.FILL_BOTH);
    layoutData.widthHint = 300;
    layoutData.heightHint = 100;
    textField.setLayoutData (layoutData);

    LinkOTronSnippet links = new LinkOTronSnippet (textField);
    links.openInBrowser (false);
    links.addListener (SWT.Selection, new Listener ()
    {
      public void handleEvent (Event e)
      {
        System.out.println ("clicked " + e.text);
        e.doit = true;
      }
    });

    textField.setText ("Some links http://google.com world\n" +
                       "A mailto:foo@foobar.com link or an ftp://link\n" +
                       "A file c:\\temp\\test.txt.\n" +
                       "A UNC path \\\\server\\path\\to\\file.");

    // start
    shell.pack ();
    shell.open ();

    while (!shell.isDisposed ())
    {
      if (!display.readAndDispatch ())
        display.sleep ();
    }

    display.dispose ();
  }

  /**
   * Create a new instance.
   */
  public LinkOTronSnippet (StyledText textField)
  {
    Display display = textField.getDisplay ();

    this.openInBrowser = true;
    this.listeners = new ArrayList ();
    this.textField = textField;
    this.urlColor = JFaceColors.getHyperlinkText (display);
    this.handCursor = display.getSystemCursor (SWT.CURSOR_HAND);
    this.busyCursor = display.getSystemCursor (SWT.CURSOR_WAIT);
    this.validSchemes = new HashSet ();

    // fall back on blue for hyperlinks
    if (urlColor == null)
      urlColor = display.getSystemColor (SWT.COLOR_BLUE);

    validSchemes.add ("file");
    validSchemes.add ("http");
    validSchemes.add ("ftp");
    validSchemes.add ("mailto");

    textField.addLineStyleListener (this);
    textField.addListener (SWT.MouseMove, this);
    textField.addListener (SWT.MouseDown, this);
  }

  public void dispose ()
  {
    if (textField != null)
    {
      textField.removeLineStyleListener (this);
      textField.removeListener (SWT.MouseDown, this);
      textField.removeListener (SWT.MouseMove, this);
      textField.removeListener (SWT.Dispose, this);

      textField = null;
    }
  }

  /**
   * Set to true to automatically open links in the system browser
   * (default true).
   */
  public void openInBrowser (boolean newValue)
  {
    openInBrowser = newValue;
  }

  public boolean openInBrowser ()
  {
    return openInBrowser;
  }

  /**
   * Add a SWT.Selection listener to listen for URL clicks (URL in
   * Event.text). Can veto/ok open in browser with Event.doit.
   */
  public void addListener (int event, Listener listener)
  {
    if (event == SWT.Selection)
    {
      listeners = new ArrayList (listeners);
      listeners.add (listener);
    }
  }

  public void removeListener (int event, Listener listener)
  {
    if (event == SWT.Selection)
    {
      listeners = new ArrayList (listeners);
      listeners.remove (listener);
    }
  }

  /**
   * The set of valid URL schemes that are recognised as links. Can
   * add "*" to this to allow any vaguely URL-looking link. Default is
   * {"http", "ftp", "mailto"}.
   */
  public Set validSchemes ()
  {
    return validSchemes;
  }

  public void handleEvent (Event e)
  {
    if (e.type == SWT.MouseMove)
    {
      textField.setCursor (urlRangeAt (e) == null ? null : handCursor);
    } else if (e.type == SWT.MouseDown)
    {
      if (e.button == 1)
      {
        UrlRange range = urlRangeAt (e);

        if (range != null)
        {
          Event selectedEvent = fireUrlSelected (range.url);

          if (selectedEvent.doit)
          {
            textField.setSelectionRange (range.start, range.length);
            textField.setCursor (busyCursor);

            openUrl (range.url);

            textField.setCursor (null);
          }
        }
      }
    }
  }

  private void openUrl (String url)
  {
    Program.launch (url);
  }

  private Event fireUrlSelected (String url)
  {
    Event event = new Event ();
    event.widget = textField;
    event.data = url;
    event.text = url;
    event.doit = openInBrowser;

    for (Iterator i = listeners.iterator (); i.hasNext ();)
      ((Listener)i.next ()).handleEvent (event);

    return event;
  }

  /**
   * Find the URL range at a given mouse event.
   */
  private UrlRange urlRangeAt (Event e)
  {
    try
    {
      return urlRangeAt
        (textField.getOffsetAtLocation (new Point (e.x, e.y)));
    } catch (IllegalArgumentException ex)
    {
      // dodgy, but no apparent way to test whether x, y is in range
      return null;
    }
  }

  /**
   * Find the URL range for a given offset into the text.
   */
  private UrlRange urlRangeAt (int offset)
  {
    maybeRebuildUrlRanges ();

    for (int i = 0; i < urlRanges.length; i++)
    {
      UrlRange range = urlRanges [i];

      if (offset >= range.start)
      {
        if (offset < range.start + range.length)
          return range;
      } else
      {
        return null;
      }
    }

    return null;
  }

  /**
   * Build URL range mapping in urlRanges if not currently valid.
   */
  private void maybeRebuildUrlRanges ()
  {
    if (urlRanges == null)
    {
      ArrayList ranges = new ArrayList ();

      scanForUrls (ranges, textField.getText (), 0);

      urlRanges = new UrlRange [ranges.size ()];
      ranges.toArray (urlRanges);
    }
  }

  private void clearUrlRangeCache ()
  {
    urlRanges = null;
  }

  /**
   * Called by text field to get style for a line.
   */
  public void lineGetStyle (LineStyleEvent e)
  {
    // clear cache when this is called => change to text
    clearUrlRangeCache ();

    ArrayList ranges = new ArrayList ();

    scanForUrls (ranges, e.lineText, e.lineOffset);

    e.styles = new StyleRange [ranges.size ()];

    for (int i = 0; i < ranges.size (); i++)
    {
      UrlRange urlRange = (UrlRange)ranges.get (i);
      StyleRange styleRange = new StyleRange ();

      styleRange.start = urlRange.start;
      styleRange.length = urlRange.length;
      styleRange.underline = true;
      styleRange.foreground = urlColor;

      e.styles [i] = styleRange;
    }
  }

  /**
   * Scan text for URL's. adding UrlRange's to a list as they're
   * found. Uses a simple state machine to scan in a single pass.
   * 
   * @param ranges The list to add ranges to.
   * @param text The text to scan.
   * @param offset The offset to add to each range.
   */
  protected void scanForUrls (List ranges, String text, int offset)
  {
    int index = 0;
    int state = IN_WILDERNESS;
    int start = -1;

    // scan each character in text
    while (index <= text.length ())
    {
      boolean eol = index == text.length ();
      char c = eol ? 0 : text.charAt (index);

      if (Character.isWhitespace (c) || eol)
      {
        if (state == IN_URL)
        {
          index = trimUrl (text, index);

          String url = text.substring (start, index);

          String scheme = schemeOf (url);

          if ((scheme != null &&
                (validSchemes.contains ("*") || validSchemes.contains (scheme))) ||
              looksLikeDOSFile (url) ||
              looksLikeUNCFile (url))
          {
            ranges.add (new UrlRange (start + offset, index - start, url));
          }
        }

        state = IN_WILDERNESS;
        start = -1;
      } else if (Character.isLetter (c))
      {
        if (state == IN_WILDERNESS)
        {
          state = IN_PREFIX;
          start = index;
        } else if (state == AT_SCHEME_SEP)
        {
          state = IN_URL;
        }
      } else if (c == ':')
      {
        if (state == IN_PREFIX)
          state = AT_SCHEME_SEP;
      } else if (c == '\\')
      {
        if (state == IN_WILDERNESS || state == IN_FORWARD_SLASH)
        {
          state = IN_BACK_SLASH;
          start = index;
        } else if (state == IN_BACK_SLASH)
        {
          // second \ in prefix means probable UNC path
          state = AT_SCHEME_SEP;
        }
      } else if (c == '/')
      {
        if (state == IN_WILDERNESS || state == IN_BACK_SLASH)
        {
          state = IN_FORWARD_SLASH;
          start = index;
        } else if (state == IN_FORWARD_SLASH)
        {
          // second / in prefix means probable UNC path
          state = AT_SCHEME_SEP;
        }
      } else
      {
        if (state == AT_SCHEME_SEP && !isEndPunct (c))
          state = IN_URL;
      }

      index++;
    }
  }

  /**
   * Trim characters off the end of a URL that probably don't belong.
   */
  private static int trimUrl (String url, int index)
  {
    do
    {
      index--;
    } while (index >= 0 && isEndPunct (url.charAt (index)));

    return index + 1;
  }

  private static boolean isEndPunct (char c)
  {
    return PUNCT_CHARS.indexOf (c) != -1;
  }

  /**
   * Get a URL's scheme (eg "http").
   */
  private static String schemeOf (String url)
  {
    int colon = url.indexOf (':');

    return colon < 2 ? null : url.substring (0, colon);
  }

  public static boolean looksLikeUNCFile (String name)
  {
    return name.startsWith ("\\\\") || name.startsWith ("//");
  }

  public static boolean looksLikeDOSFile (String name)
  {
    return name.length () >= 3 &&
            Character.isLetter (name.charAt (0)) &&
            name.charAt (1) == ':' &&
            (name.charAt (2) == '\\' || name.charAt (2) == '/'); 
  }

  /**
   * A range in the text field that represents a URL.
   */
  static class UrlRange
  {
    public int start;
    public int length;
    public String url;

    public UrlRange (int start, int length, String url)
    {
      this.start = start;
      this.length = length;
      this.url = url;
    }

    public String toString ()
    {
      return "Range [" + start + ", " + length + ", \"" + url + "\"]";
    }
  }
}

