Open Declaration of a function does not work in a c-file, when there is an local pointer to typedef in another function in the same file and the declaration of the function is in a headerfile.
E.g.

//Bug when you try to use Open Declaration on xyz in the c-file:
//In the header called bug_header.h:
void xyz(void);

//In the c-file:
#include "bug_header.h"

void xyz(void)		// "open declaration" an xyz here fails, iff...
{
}

typedef int kkk; 

void xx(void){
	kkk *var;	// ... type here is a automatic pointer to a typedef
}

This bug only exists when working with typedef, when you use int instead of kkk it works correctly.
E.g.

//Well working:
//In the header called ok_header.h
void xy(void);

//In the c-file:
#include "ok_header.h"

void xy(void)
{
}

void xx(void)
{
	int *var;
}

