						setChartType(view);
						checkLegend();
					}

					public void widgetDefaultSelected(SelectionEvent e)
					{}
				});

				return panel;
			}
		};
		tbMgr.add(comboItem);

		// Add combo to change graph style to viewtoolbar
		IContributionItem styleItem = new ControlContribution("style")
		{
			protected Control createControl(Composite parent)
			{
				Composite panel = new Composite(parent, SWT.NONE);
				Display display=parent.getDisplay();
				panel.setBackground(display.getSystemColor(SWT.COLOR_GREEN));
				panel.setLayout(new RowLayout(SWT.HORIZONTAL));
				Label label = new Label(panel, SWT.NONE);
				label.setText(Strings.getString("GraphView.Style"));
				_theme = new Combo(panel, BORDER);
				_theme.add(Strings.getString("GraphView.WinXP"));
				_theme.setData(Strings.getString("GraphView.WinXP"),
						EChartTheme.WINDOWS_XP);
				_theme.add(Strings.getString("GraphView.Excel"));
				_theme.setData(Strings.getString("GraphView.Excel"), EChartTheme.EXCEL);
				_theme.add(Strings.getString("GraphView.TChart"));
				_theme
						.setData(Strings.getString("GraphView.TChart"),
								EChartTheme.DEFAULT);
				_theme.add(Strings.getString("GraphView.Classic"));
				_theme.setData(Strings.getString("GraphView.Classic"),
						EChartTheme.CLASSIC);
				_theme.add(Strings.getString("GraphView.BlueSky"));
				_theme.setData(Strings.getString("GraphView.BlueSky"),
						EChartTheme.BLUE_SKY);
				_theme.add(Strings.getString("GraphView.Business"));
				_theme.setData(Strings.getString("GraphView.Business"),
						EChartTheme.BUSINESS);
				_theme.setText(Strings.getString("GraphView.WinXP"));
				_theme.addSelectionListener(new SelectionListener()
				{
					public void widgetSelected(SelectionEvent e)
					{
						String themeName = _theme.getText();
						EChartTheme theme = (EChartTheme) _theme.getData(themeName);
						_chart.setTheme(theme);
						checkLegend();
					}

					public void widgetDefaultSelected(SelectionEvent e)
					{}
				});

				return panel;
			}
		};
		tbMgr.add(styleItem);
		// TODO add actions for toggle between lines and bars
		tbMgr.add(new Separator("export"));
	}

